//import FirstSection from "./component/FirstSection";
import Aos from 'aos';
import 'aos/dist/aos.css';
import About from './component/About';
import FirstSection from './component/FirstSection';


function App() {
  Aos.init ({
    duration : 1800,
    offset : 0
  })
  return (
    <div className="overflow-hidden">
      <FirstSection />
      <About />
    </div>
  );
}

export default App;
